$("#carouselExample").on("slide.bs.carousel",(function(e){var n=$(e.relatedTarget).index(),r=$(".carousel-item").length;if(n>=r-3)for(var o=4-(r-n),s=0;s<o;s++)"left"==e.direction?$(".carousel-item").eq(s).appendTo(".carousel-inner"):$(".carousel-item").eq(0).appendTo(".carousel-inner")}));let scrollY=window.scrollY;const header=document.querySelector(".navbar");window.addEventListener("scroll",(function(){scrollY=this.scrollY,scrollY>0?header.classList.add("scroll-header"):0==scrollY&&header.classList.remove("scroll-header")}));const menuContainer=document.querySelector(".navbar-toggler");document.addEventListener("click",(function(e){const n=e.target.classList;n.contains("fas")?menuContainer.classList.add("active"):n.contains("menu_close")&&menuContainer.classList.remove("active")}));